  }, "\uAE30\uD0C0")), mdx("p", null, "\uC544\uB798\uB85C \uAC08\uC218\uB85D \uC810\uC810 \uAD6C\uCCB4\uD654\uB418\uB294 \uAC83\uC774 \uBCF4\uC77C \uAC83\uC774\uB2E4. \uADF8\uB7EC\uB098 \uC704\uC5D0\uC11C \uC544\uB798\uC758 \uC21C\uC11C\uB300\uB85C \uC18C\uD504\uD2B8\uC6E8\uC5B4\uAC00 \uAC1C\uBC1C\uB418\uB294 \uAC83\uC740 \uC544\uB2C8\uB2E4.\n\uC2E4\uC81C \uD504\uB85C\uC81D\uD2B8\uC5D0\uC11C\uB294 \uC774 \uCD94\uC0C1\uD654 \uB2E8\uACC4\uB4E4\uC774 \uB3D9\uC2DC\uC5D0 \uBC1C\uC0DD\uD55C\uB2E4."), mdx("p", null, "\uC2DC\uB3C4 \uB54C\uB3C4 \uC5C6\uC774 \uBC1C\uC0DD\uD558\uB294 \uAC01\uAC01\uC758 \uCD94\uC0C1\uD654 \uB2E8\uACC4\uC5D0\uC11C \uAC1C\uBC1C\uC790\uB4E4, \uD639\uC740 \uBE44 \uAC1C\uBC1C\uC790\uB4E4\uAE4C\uC9C0\uB3C4 \uC758\uC0AC\uC18C\uD1B5\uC744 \uD558\uAE30 \uC704\uD574\n\uC0AC\uB78C\uB4E4\uC774 \uC8FC\uB85C \uD0DD\uD558\uB294 \uD3B8\uB9AC\uD55C \uC758\uC0AC\uC18C\uD1B5 \uBC29\uC2DD\uC740 \uBC14\uB85C \uADF8\uB9BC\uC744 \uADF8\uB9AC\uB294 \uAC83\uC774\uB2E4.\n\uADF8\uB7EC\uB098 \uBAA8\uB450\uAC00 \uADF8\uB9BC\uC744 \uADF8\uB9AC\uB294 \uBC29\uC2DD\uC774 \uB2E4\uB974\uB2E4 \uBCF4\uB2C8 \uC774\uC5D0 \uBD88\uD3B8\uD568\uC744 \uB290\uB080 \uC0AC\uB78C\uB4E4\uC740 \uC544\uC608 \uC774\uB7EC\uD55C \uADF8\uB9BC\uB4E4\uC744 \uD45C\uC900\uD654\uD558\uACE0\uC790 \uD588\uB294\uB370,\n\uB54C\uBB38\uC5D0 \uAC01\uAC01\uC758 \uC0C1\uD669\uB9C8\uB2E4 \uC4F0\uC774\uB294 \uADF8\uB9BC\uC5D0 \uB300\uD55C \uC6A9\uC5B4\uC640 \uADF8\uB9BC\uC744 \uADF8\uB9AC\uB294 \uADDC\uCE59\uB4E4\uC774 \uC815\uD574\uC9C0\uAC8C \uB418\uC5C8\uB2E4."), mdx("h2", null, "\uC815\uB9D0 \uD544\uC694\uD558\uC9C0 \uC54A\uC73C\uBA74 \uD558\uC9C0 \uB9D0\uC544\uB77C"), mdx("p", null, "\uC544\uB798\uB85C \uB118\uC5B4\uAC00\uAE30 \uC804\uC5D0 \uD55C \uAC00\uC9C0 \uBA85\uC2EC\uD574\uC57C \uD560 \uADDC\uCE59\uC740 ", mdx("strong", {
